CREATE TABLE country (
  id BIGINT GENERATED BY DEFAULT AS IDENTITY NOT NULL,
  country_name VARCHAR(255),
  status SMALLINT,
  iso_code VARCHAR(255),
     created_at BIGINT,
   updated_at BIGINT,
   created_by VARCHAR(255),
   updated_by VARCHAR(255),
  CONSTRAINT pk_country PRIMARY KEY (id)
);

